// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "../Structs.sol";

/**
 * @title Bop Levels Handler
 * @notice definition and management of bop levels info
 * @author Eric Nordelo
 */
contract BopLevelsHandler is AccessControl {
    bytes32 public constant OWNER = keccak256("OWNER");

    uint256 private constant TRAX_DECIMALS = 18;

    BopLevel[] private _levels;

    // 1 TRAX needed for Bop creation (could be changed by owner)
    uint256 public traxToCreateBop = 1 * 10**TRAX_DECIMALS;

    uint256 public startingLevel = 1;

    constructor(BopLevel[] memory levels) {
        require(levels.length > 0, "No levels found");

        for (uint256 i; i < levels.length; i++) {
            require(levels[i].beatsForNextLevel > 0, "Invalid levels");
            _levels.push(levels[i]);
        }

        // deployer can give and remove roles
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(OWNER, msg.sender);
    }

    function setTraxToCreateBop(uint256 _amount) external onlyRole(OWNER) {
        require(_amount > 0, "Invalid amount");
        traxToCreateBop = _amount;
    }

    function setStartingLevel(uint256 _number) external onlyRole(OWNER) {
        if (_number == 0 || _number > _levels.length) {
            revert("Invalid starting level");
        }
        startingLevel = _number;
    }

    function getLevels() external view returns (BopLevel[] memory levels) {
        return _levels;
    }

    function getLevelInfo(uint256 _level) external view returns (BopLevel memory level) {
        if (_level == 0 || _level > _levels.length) {
            revert("Invalid level");
        }
        return _levels[_level - 1];
    }

    /**
     * @dev TODO add update levels functionality (only owner)
     */
}

